	this.ajoutCoucheGeojson = function () {

		if (élément.properties.couleur){

			}

			var couleurEltCouche = "red";	
			}
		if (élément.geometry.type == "MultiPolygon")	{
			var styleCouchePolygon = {	
				color: couleurEltCouche,

			};
			return styleCouchePolygon;
		}
		
		if (élément.geometry.type == "MultiLineString")	{
			var styleCoucheMLS = {

				opacity: 1	
			};
			return styleCoucheMLS;
		}
		
	};

	function traiterEltsCouche (élément, couche) {
		
		function nettoyerValNulles() {
			for (var nomPpté in élément.properties) {	
				if (élément.properties[nomPpté] == null) {
					élément.properties[nomPpté] = "Non défini";}	
			}
		}

		function formaterLienHttp(){
			for (var nomPpté in élément.properties) {
				if (nomPpté.match(/[Ll]ien/) && élément.properties[nomPpté] !== "Non défini") {
					élément.properties[nomPpté] = "<a href=" + élément.properties[nomPpté].replace(/ /g,"%20") + " title="+ élément.properties[nomPpté].replace(/ /g,"%20") + " target=_blank> " + "Accéder au lien</a>";	
				}
				else if (nomPpté.match(/[Ee]mail|[Mm]ail/) && élément.properties[nomPpté] !== "Non défini") {
					élément.properties[nomPpté] = "<a href=mailto:" + élément.properties[nomPpté] + " target=_blank> " + élément.properties[nomPpté] + " </a>";
				}
			}	
		};
		
		function surlignerElt() {
			function créerSurlignage () {
				couche.setStyle({
					color: "#ff6600",
					weight: 10,
					opacity: 0.5
				});
			}
			function resetSurlignage () {
				if (élément.properties.couleur){		
					var couleurEltCouche = élément.properties.couleur;  
				}
				else {
					var couleurEltCouche = "red";	
				}
				couche.setStyle({							
					color: couleurEltCouche,
					weight: 3,
					opacity: 1
				});
			}						
			typeGeometryG = élément.geometry.type;	
			if (typeGeometryG !== "Point") {
				couche.on({
					click: créerSurlignage,	
					popupclose: resetSurlignage
				});	
			}
		};
			
		function creerTabLegende() {
			if (élément.properties.couleur == "Non défini" || typeof élément.properties.couleur === "undefined" && élément.geometry.type !== "Point") {
				élément.properties.couleur = "red";
			}	
			if (élément.properties.legende){					
				presenceLegende = true;
				tabComposantLeg.push([élément.geometry.type, élément.properties.legende, élément.properties.couleur, élément.properties.icone, élément.properties.afficherlegouverture]);
			}
			tabGeomCouche.push([élément.geometry.type, élément.properties.nomcouche]);	
		};

			var tableauContenuPopup = [], tableauContenuTooltip = [];

					tableauContenuPopup.unshift("<b>"+ nomPpté + ":</b> " + élément.properties[nomPpté]);	
				} 
				else {
				if (!nomPpté.match(/^([Cc]ouleur|[Ll]egende|[Ii]cone|to_timestamp|nomcouche|afficherlegouverture)$/)) {
					tableauContenuPopup.push("<b>"+ nomPpté + ":</b> " + élément.properties[nomPpté]);

		  var tabPopupLegMarker = [], tabTooltipLegMarker = [], tabPopupLegMLS = [], tabTooltipLegMLS = [], tabPopupLegMP = [], tabTooltipLegMP = [];

				coucheMP.bindPopup(tabPopupLegMP.join("<br />"), {maxWidth: 400, closeOnClick:true});

	}

	for (i=0; i < tabCoucheMetier.length; i++){
		tabCoucheMG.push(L.geoJson(tabCoucheMetier[i], {style: styleCoucheMétier, onEachFeature: traiterEltsCouche,	pointToLayer: creerIconeCusto }));
		}
	}	
	

	this.dessinerCarte = function () {		
		var maPosition = L.Permalink.getMapLocation();
		maCarte = L.map(this.conteneurId, {
			center: maPosition.center,
			zoom: maPosition.zoom,
			zoomDelta: 0.6,
			zoomSnap:0.1,
			layers: cartoDB,
			zoomControl: false,
			attributionControl: false,
			closePopupOnClick: false
		});	
		if (L.Browser.mobile){maCarte.setView([43.8, 4.1], 8.7)};
		
		var copyright = L.control.attribution({position:"bottomleft"});
		copyright.setPrefix('').addAttribution("<a href='https://intranet.gard.fr/fr/organigramme/organigramme-presidente-fr/organigramme-direction-generale-des-services-fr/organigramme-dgs-direction-fr/organigramme-dga-mobilites-et-logistique-fr/organigramme-dgaml-direction-d-appui-fr/organigramme-dgaml-dapp-pole-systemes-d-information-fr.html' target='_blank'>Pôle des Systèmes d'Information (DGaML - DAppui)</a>");
		copyright.addTo(maCarte);

		ctrlScale = L.control.scale({position: "bottomright", imperial: false});
		ctrlScale.addTo(maCarte);

		var strCaseACocher = "0";
		var tabCaseACocher = [];
		tabCaseACocher = strCaseACocher.split(",");
		if (tabCaseACocher.length <= tabCoucheMetier.length) {
			for (i=0; i < tabCaseACocher.length; i++){
				if (tabCaseACocher[i] == "1"){
					tabCoucheMG[i].addTo(maCarte);
				}
			}
		}	

	tabNettoyé = [];
	function filtrerDoublons(tableau) {
		var eltsTrouvés = [];
		for (i=0 ; i < tableau.length; i++) {
			var eltsTrouvésTxt = JSON.stringify(tableau[i]);
			if (eltsTrouvés[eltsTrouvésTxt]) { continue; }
			tabNettoyé.push(tableau[i]);
			eltsTrouvés[eltsTrouvésTxt] = true;
		}
		return tabNettoyé;
	}
	
if (presenceLegende) {	
	filtrerDoublons(tabComposantLeg);
	
			for (i=0; i<tabNettoyé.length; i++){
				if (tabNettoyé[i][0] == "MultiLineString"){
					tabNettoyé[i][0] = "polyline";
					}
				if (tabNettoyé[i][0] == "MultiPolygon" ){
					tabNettoyé[i][0] = "polygon";
				}
				if (tabNettoyé[i][0] == "Point") {
					tabNettoyé[i][0] = "image";
				}
			}		

	ordreMarkerLeg = _.groupBy(tabEltsMarkerLeg, "options.icon.options.iconUrl");	
	ordreMLSLeg = _.groupBy(tabEltsMLSLeg, "options.nomCoucheMLSEtCouleur");	
	ordreMPLeg = _.groupBy(tabEltsMPLeg, "options.nomCoucheMPEtCouleur");
	var listeCouchesLeg = Object.assign(ordreMarkerLeg,ordreMLSLeg,ordreMPLeg);
	var tabCouchesLGLeg = [];
	var tabCouchesLGLeg = Object.values(listeCouchesLeg).map(listOfCouches => L.layerGroup(listOfCouches));

	for (i=0; i < tabCouchesLGLeg.length; i++){
		if (tabNettoyé[i][4] === true || typeof tabNettoyé[i][4] === "undefined" ){
			tabCouchesLGLeg[i].addTo(maCarte);
		}
	}

	for (i=0; i < tabNettoyé.length; i++){
		if (typeof tabNettoyé[i][4] === "undefined"){
			tabNettoyé[i][4] = true;
		}
	}	
	for (i=0; i<tabNettoyé.length; i++){
			tabNettoyé[i][4] = !tabNettoyé[i][4];
	}

	var tabCtrlLegend = [], tabCtrlLegendeObj = [];
	for (i=0; i < tabNettoyé.length; i++) {	
			tabCtrlLegend.push({label: tabNettoyé[i][1], type: tabNettoyé[i][0], color:tabNettoyé[i][2], url: tabNettoyé[i][3], inactive:tabNettoyé[i][4], layers: tabCouchesLGLeg[i]});	
			var objetLegend = Object.assign({}, ...tabCtrlLegend.map(item => ({label: item.label, type: item.type, url: item.url, color: item.color, inactive: item.inactive, layers: tabCouchesLGLeg[i]})));
			tabCtrlLegendeObj.push(objetLegend);
	}			

	blocLegende = L.control.Legend({title: null, position: "bottomright", opacity: 0.8, legends: tabCtrlLegendeObj});
	blocLegende.addTo(maCarte);
}					
		

	tabNettoyé = [];
	filtrerDoublons(tabGeomCouche);	
		
	var priorite = 50000;
	for (i=0; i < tabNettoyé.length; i++) {
		if (tabNettoyé[i][0] == "Point") {
			tabCoucheMG[i].eachLayer(function (layer) {layer.setZIndexOffset(priorite);});
			priorite = priorite - 1000;			
		}
		if (tabNettoyé[i][0] == "MultiPolygon")  {
			tabCoucheMG[i].bringToBack();
		}
		if (tabNettoyé[i][1] == null) {
			tabNettoyé[i][1] = "Couche " + (i+1);
		}	
	}
	var prioriteLeg = 1000000;
	for (i=0; i < tabEltsMarkerLeg.length; i++) {
		tabEltsMarkerLeg[i].setZIndexOffset(prioriteLeg);
		prioriteLeg = prioriteLeg - 100;			
	}

	for (i=0; i < tabEltsMLSLeg.length; i++) {
		tabEltsMLSLeg[i].bringToBack();		
	}

	for (i=0; i < tabEltsMPLeg.length; i++) {
		tabEltsMPLeg[i].bringToBack();		
	}
	
	var fondsCarte = {		
		"CartoDB N&B": cartoDB, 
		"Plan IGN": fdcIGN,		
		"Stadia map": StadiaMap,
		"Google Satellite": googleSat,	
		"IGN ortho": orthoIGN			
	};	

	var tabCtrlboxNom = [];
	var libelleCouche = {};
	for (i=0; i < nbreDeVues; i++) {	
		tabCtrlboxNom.push({nom: tabNettoyé[i][1], couche: tabCoucheMG[i]});	
	}	
	libelleCouche = Object.assign({}, ...tabCtrlboxNom.map(item => ({ [item.nom]: item.couche })));

	var ctrlBoxRepliée = false;		
	if (presenceLegende){	
		var nbrEltsLegende = tabCtrlLegend.length;
		if (ctrlBoxRepliée || nbrEltsLegende > 17 || L.Browser.mobile){
			ctrlBoxCouches = L.control.layers(fondsCarte, libelleCouche,  {collapsed:true});
			ctrlBoxCouches.addTo(maCarte);
			}
		else {
			ctrlBoxCouches = L.control.layers(fondsCarte, libelleCouche,  {collapsed:false});				
			ctrlBoxCouches.addTo(maCarte);
			}
		if (nbrEltsLegende > 24) {	
			blocLegende.remove();
			blocLegende = L.control.Legend({title:null, collapsed:true, position: "bottomright", opacity:0.8, legends:tabCtrlLegendeObj});
			blocLegende.addTo(maCarte);
		}
	}
	else {
		ctrlBoxCouches = L.control.layers(fondsCarte, libelleCouche,  {collapsed:false});		
		ctrlBoxCouches.addTo(maCarte);
	}

		var permalink = false;
		if (permalink) {
			L.Permalink.setup(maCarte);		
			maCarte.center = maPosition.center;
			maCarte.zoom = maPosition.zoom;
		}	

		if (!L.Browser.mobile){
			var ctrlZoom = L.control.zoom({zoomInTitle: "Zoom avant", zoomOutTitle: "Zoom arrière"});
			ctrlZoom.addTo(maCarte);
		}	
	}; 	

	this.serviceVisu = function () {		
			pegmanIcon = new L.Icon({iconUrl: "/leaflet/Ressources/API_JS/images/streetview.png", iconSize: [16,32], iconAnchor: [8,33]});
			pegman = L.marker(maCarte.getCenter(),{icon:pegmanIcon});
			maCarte.on("move", function() {
				pegman.setLatLng(maCarte.getCenter()); 
			});

			var tabServices = [];
			tabServices.push({option: "position", valeur: "bottomright"}, {option: "googleSV", valeur: true},{option: "mapillary", valeur: true},{option: "googlemap", valeur: true}, {option: "IGN", valeur: true},{option: "IGN3D", valeur: true},{option: "googleearth", valeur: false});			
			var services = Object.assign({}, ...tabServices.map(item => ({[item.option]: item.valeur})));
			var objPluginStreetview = L.streetView(services);

			function afficherPluginStreetview() {			
				objPluginStreetview.addTo(maCarte);
				pegman.addTo(maCarte).setOpacity(1).setZIndexOffset(1100000);
				/*ctrlInfo.remove();
				ctrlInfo.addTo(maCarte);*/
			};
			function masquerPluginStreetview() {
				objPluginStreetview.remove();
				pegman.setOpacity(0);
			};
			afficherPluginStreetview();
			maCarte.on("dblclick", afficherPluginStreetview);
			pegman.on("click", masquerPluginStreetview);
			maCarte.on("keydown", masquerPluginStreetview);		
		}

	this.zoomObjet = function () {		
		function zoomPolyG(carte, coucheGeojson) {
			coucheGeojson.on("click", function zoomPoly (evt) {
				carte.fitBounds(evt.layer.getBounds(), {maxZoom: 20});
				});
		}		
		function zoomMarkerG(carte, coucheGeojson) {
			coucheGeojson.on("click", function zoomMarker (evt) {
				carte.fitBounds([evt.layer.getLatLng()], {maxZoom: 18});
			});
		}
		
		for (i=0; i < nbreDeVues; i++) {
			if (tabNettoyé[i][0] == "Point") {							
				zoomMarkerG(maCarte, tabCoucheMG[i]);			
			}
			else {
				zoomPolyG(maCarte, tabCoucheMG[i]);
			}
		}
		
		function créerSurlignageClicLeg (couche) {
			couche.setStyle({
				color: "#ff6600",
				weight: 10,
				opacity: 0.6
			});
		};
		function resetSurlignageLeg (couche, coucheCouleur) {		
			couche.on("popupclose", function ResetSurlignageL(){
				couche.setStyle({							
					color: coucheCouleur,
					weight: 3,
					opacity: 0.9
				});
			});
		};
		function zoomPolyLeg(carte, coucheLine, coucheLineColor) {
			coucheLine.on("click", function zoomPolyL () {
				carte.fitBounds(coucheLine.getBounds(), {maxZoom: 20});		
				créerSurlignageClicLeg(coucheLine);
				resetSurlignageLeg(coucheLine, coucheLineColor);
			});
		};	

		for (i=0; i < tabEltsMLSLeg.length; i++){
			zoomPolyLeg(maCarte, tabEltsMLSLeg[i], tabEltsMLSLeg[i].options.color);			
		}
		for (i=0; i < tabEltsMPLeg.length; i++){
			zoomPolyLeg(maCarte, tabEltsMPLeg[i], tabEltsMPLeg[i].options.color);			
		}	

		function zoomMarkerLeg(carte, couchePt) {
			couchePt.on("click", function zoomMarkerLeg () {
				carte.fitBounds([couchePt.getLatLng()], {maxZoom: 18});
			});
		}		
		for (i=0; i < tabEltsMarkerLeg.length; i++){
			zoomMarkerLeg(maCarte,tabEltsMarkerLeg[i]);
		}
	};	
	
	
	this.limiteAdmin = function(geoJsonLimite) {
		var coucheLimiteAdmin = L.geoJson(geoJsonLimite, {style: styleLimite});	
		coucheLimiteAdmin.addTo(maCarte);
    };

	this.recentrer = function () {
		var ctrlRecentrer = L.easyButton("fa-refresh fa-lg", function (btnR, carteR) {
			carteR.setView(carteLeaflet.coordCentreCarte, carteLeaflet.zoomInitial);
			}, "Recentrer la carte", {position: "topleft"});
		ctrlRecentrer.button.style.width = "26px";
		ctrlRecentrer.button.style.height = "26px";
        ctrlRecentrer.addTo(maCarte);
    };
	
	this.rechercherLieu = function(carte) {
		var limiteGeo = new google.maps.LatLngBounds(new google.maps.LatLng(43.5, 3.2), new google.maps.LatLng(44.5, 5));
		var ctrlGooglePlace = new L.Control.GPlaceAutocomplete({
			position: "topleft",
			collapsed_mode: true,
			prepend: false, 
			autocomplete_options: {types:["geocode"], componentRestrictions:{country:"fr"}, bounds:limiteGeo},		
			callback: function(place){
				carte.setZoom(16);	
            	carte.panTo([place.geometry.location.lat(), place.geometry.location.lng()]);
				carte.setZoom(16);			
			}
		});	
		var buttonR =  L.DomUtil.get(ctrlGooglePlace.icon);
		buttonR.title = "Rechercher lieu";		
		ctrlGooglePlace.addTo(maCarte);	
	};

	this.mesurer = function () {
		var ctrlDistance = new	L.control.ruler({position: "topleft"});
		ctrlDistance.addTo(maCarte);
	}
	
	this.imprimer = function () {
		var ctrlImpression = new L.control.browserPrint({
			title: "Imprimer",
			closePopupsOnPrint: false,
			printModes: [
				L.control.browserPrint.mode.landscape("Paysage"),
				L.control.browserPrint.mode.portrait("Portrait"),
				L.control.browserPrint.mode.custom("Sélec. zone", "A4"),
				L.control.browserPrint.mode.auto("Auto")
			],
		});
		L.Control.BrowserPrint.Utils.registerLayer(L.GridLayer.GoogleMutant,"L.GridLayer.GoogleMutant", function(layer) {
			return new L.GridLayer.GoogleMutant({type: "hybrid", maxZoom: 22});	
			}
		);		
		ctrlImpression.addTo(maCarte);
		maCarte.on("browser-print-start", function(e){
			blocLegende.addTo(e.printMap);
		});
		maCarte.on("browser-print-end", function(){
			ctrlInfo.remove();
			blocLegende.addTo(maCarte);
			ctrlInfo.addTo(maCarte);
		});
	};
	
	this.information = function () {
		var contenuInfo = "Cette carte pr&#233;sente les sites administratifs et la ou les structures hi&#233;rarchiques de plus haut niveau qui s\&#39;y trouvent par DGA.<br><br>Mise &#224; jour quotidienne.";
		var fenêtreInfo = new L.control.dialog({size: [320, 300], anchor: [200, 850], position:"topleft", initOpen: true, minSize: [100, 100], maxSize: [500, 600]});
		ctrlInfo = L.easyButton("fa-info-circle fa-3x", function (btnA, carteA) {				
			fenêtreInfo.setContent(contenuInfo).addTo(carteA);  
			}, "Informations", {position: "bottomright"});
		ctrlInfo.button.style.width = "auto";
		ctrlInfo.button.style.height = "42px";
		ctrlInfo.button.style.color = "#4f5697";
		ctrlInfo.addTo(maCarte);				
    };
	
	this.aide = function () {
  	  	var contenuAide = [			
		"<p><b>Légende dynamique en bas à droite:</b> masquer ou afficher chaque élément de la légende en cliquant dessus.</p>",
		"<p><b>Visualisation Street View, Mapillary, IGN, Google Maps:</b> double-cliquer n'importe où sur la carte pour faire apparaitre 'Pegman' (personnage jaune) et le bloc de service de visualisation en bas à droite. Déplacer le fond de carte pour positionner Pegman puis cliquer sur l'icone de l'un des services pour ouvrir, dans un nouvel onglet, la page correspondante à la position. Désactiver le service en cliquant sur Pegman ou une touche clavier.</p><a href='/leaflet/Ressources/API_JS/images/visu-leaflet.png' target='_blank'><img src='/leaflet/Ressources/API_JS/images/visu-leaflet.png' title='Service visualisation' style='width:50%;  display: block; margin-left: auto;  margin-right: auto;'></img></a>",	
		"<p><b>Mesure de distance:</b> cliquer sur le bouton 'Règle', qui se colore, pour mesurer une distance sur la carte en km (3 décimales). Tracer une ligne avec la souris, cliquer pour créer des mesures intermédiaires et des changements d'angle. Pour terminer la mesure d'un segment (dernière valeur = longeur totale du segment), appuyer sur la touche 'Echap'. Il est ainsi possible de mesurer plusieurs tronçons. Recliquer sur le bouton 'Régle' pour effacer les mesures effectuées.</p><a href='/leaflet/Ressources/API_JS/images/regle-leaflet.png' target='_blank'><img src='/leaflet/Ressources/API_JS/images/regle-leaflet.png' title='Mesure distance' style='width:60%;  display: block; margin-left: auto;  margin-right: auto;'></img></a>",
		"<p><br></p>"
		].join("");
		if (!L.Browser.mobile){
    			var fenêtreAide = new L.control.dialog({size: [710,620], anchor: [0, 100], position:"topleft", initOpen: true, minSize:[350,250], maxSize:[900,700]});
		} else {
			var fenêtreAide = new L.control.dialog({size: [290,300], anchor: [0, 50], position:"topleft", initOpen: true, minSize:[260,250], maxSize:[600,400]});
		}
		ctrlAide = L.easyButton("fa-question fa-2x", function (btnA, carteA) {				
			fenêtreAide.setContent(contenuAide).addTo(carteA);   
			<!-- fenêtreAide.hideResize(); -->
			}, "Utilisation de la carte", {position: "topleft"});
		ctrlAide.button.style.width = "26px";
		ctrlAide.button.style.height = "26px";
		ctrlAide.button.style.color = "#F9AC10";
		ctrlAide.addTo(maCarte);				
    };
	
	this.logo = function (imgSource, largeur, imgTooltip, lienSite, typeLien) {
        L.Control.Logo = L.Control.extend({
            onAdd: function () {
                img = L.DomUtil.create("img");
                img.src = imgSource;
                img.style.width = largeur;	
                img.title = imgTooltip;
				L.DomEvent.on (img, "click", function() {
					window.open(lienSite, typeLien)
					}
				);	
				return img;
            }
        });	
		var ctrlLogo = new L.Control.Logo({position: "bottomleft"});	
		ctrlLogo.addTo(maCarte);
			
	};
	
	this.titre = function(){
		var ctrlTitre = L.control({position: "bottomleft"});
		valeurTitre1 = "Carte Web Leaflet CD30";
		valeurTitre2  =  " - 11/2023" ;
		var dateTitre = true;
			if (dateTitre) {	
				valeurTitre = valeurTitre1 + valeurTitre2;
			}
			else {
				valeurTitre = valeurTitre1;
			}	
		L.CtrlTitre = L.Control.extend ({
			onAdd : function () {				
			var divTitre = L.DomUtil.create("divT", "titre infotitre"); 
			divTitre.innerHTML += valeurTitre;
			document.getElementById("ti").innerHTML = valeurTitre;		
			return divTitre;
			}
		});
			L.ctrlTitre = function(options) {			  	
				return new L.CtrlTitre(options);
			};
			
			L.ctrlTitre({position: "bottomleft"}).addTo(maCarte);
			 
			(maCarte).on("browser-print-start", function(e){
				L.ctrlTitre({position: "bottomleft"}).addTo(e.printMap);
			});
	};
	
}

function main() {
    	carteLeaflet = new CarteLeaflet("carteId", [43.96, 4.1], 10);	
	carteLeaflet.ajoutCoucheGeojson();	
	carteLeaflet.dessinerCarte();
    	carteLeaflet.limiteAdmin(Gard);
	carteLeaflet.serviceVisu();
	if (clicZoomActif){carteLeaflet.zoomObjet()};	
	carteLeaflet.recentrer();
	carteLeaflet.rechercherLieu(maCarte);
	carteLeaflet.titre();	
	if (!L.Browser.mobile){		
		{carteLeaflet.logo("/leaflet/Ressources/legard.jpg", "70px", "Le Gard", "http://www.gard.fr")};		
		carteLeaflet.mesurer();
		carteLeaflet.imprimer();		
		carteLeaflet.information();		
	}
	carteLeaflet.aide();
}
		
</script>
